import React from 'react';

const FlagFi = props => (
  <svg viewBox="0 0 1800 1100" {...props}>
    <path fill="#fff" d="M0 0h1800v1100H0z" />
    <path fill="#003580" d="M0 400h1800v300H0z" />
    <path fill="#003580" d="M500 0h300v1100H500z" />
  </svg>
);

export default FlagFi;
